      box-shadow: 0 2px 8px #0001;
      padding: 48px 32px 32px 32px;

    .back-button {

      top: 10px;
      left: 10px;
      z-index: 9999;
    }

    .back-button button {
      padding: 8px 12px;
      background-color: #1976d2;
      color: white;
      border: none;
      border-radius: 4px;
      font-size: 14px;
      cursor: pointer;
      box-shadow: 0 2px 6px rgba(0,0,0,0.2);
    }
